DROP TABLE IF EXISTS `test_case`;
CREATE TABLE `test_case` (
  `case_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用例ID',
  `suite_id` int(11) NOT NULL COMMENT '方法ID',
  `case_type` int(1) unsigned zerofill NOT NULL COMMENT '0-正常步骤 1-执行SQL',
  `method_address` varchar(2048) NOT NULL COMMENT '请求地址',
  `case_des` varchar(2048) NOT NULL COMMENT '用例描述',
  `case_data` varchar(2048) DEFAULT NULL COMMENT '用例json数据',
  `case_assert_type` int(1) NOT NULL COMMENT '断言类型 0-不断言，1-断言返回结果，2-断言SQL结果',
  `case_assert_value` varchar(255) DEFAULT NULL COMMENT '断言值',
  `before_run_type` int(1) DEFAULT NULL COMMENT '用例执行前处理类型 0-不处理，1-执行其他步骤，2-替换业务变量',
  `before_run` int(11) DEFAULT NULL COMMENT '用例执行前处理',
  `after_run_type` int(1) unsigned zerofill DEFAULT NULL COMMENT '用例执行后处理，0-不处理，1-处理token，2-处理业务变量更新',
  `after_run` int(11) DEFAULT NULL COMMENT '用例执行后处理',
  `case_run_num` int(2) NOT NULL,
  `create_date` timestamp NOT NULL DEFAULT '2019-01-01 00:00:00',
  `update_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `is_del` int(1) unsigned zerofill NOT NULL COMMENT '是否删除',
  `user_id` int(20) DEFAULT NULL,
  PRIMARY KEY (`case_id`)
) ENGINE=InnoDB AUTO_INCREMENT=164 DEFAULT CHARSET=utf8mb4;

